import { useNavigate } from "react-router-dom"
import Navbar from "./Navbar"
function Fpage(){
    const nav=useNavigate()
    const handleC=(e)=>{
     e.target.value==='madmin'?nav('/aitem')  :nav('/')
    }

    return(
        <>
        <Navbar/>
        <h10 className="font-semibold text-sm ml-10">Admin Panel</h10>
        <h4 className="font-semibold ml-11">Pls enter password</h4>
        <input  type='text' className=" ml-10  rounded-md text-center border-emerald-800 
        border-7 border" onChange={(e)=>{handleC(e)}}></input>
        </>
    )
}

export default Fpage
